import { createSlice } from '@reduxjs/toolkit'
import { NavLink } from "react-router-dom";
import "./navSliceMobile.css"
const initialState = {
  value: '',
}

export const navSliceMobile = createSlice({
  name: 'navBarMobile',
  initialState,
  reducers: {
    ledger_mobileNav: (state) => {
        state.value =<> 
            <li className='mobile_navs' id='apps'><NavLink></NavLink></li>
            <li className='mobile_navs' id='search'><NavLink></NavLink></li>
            <li className='mobile_navs' id='notifications'><NavLink ></NavLink></li>
            <li className='mobile_navs' id='profile'><NavLink></NavLink></li>
            <li className='mobile_navs' id='options'><NavLink></NavLink></li>
        </>
    },

    ledger_subPages_mobileNav: (state) => {
        state.value =<> 
            <li id='apps'><NavLink></NavLink></li>
            <li id='notifications'><NavLink ></NavLink></li>
            <li id='profile'><NavLink ></NavLink></li>
            <li id='options'><NavLink ></NavLink></li>
        </>
    },

    clear_mobileNav: (state) => {
        state.value =<></>
    },
  },
})

// Action creators are generated for each case reducer function
export const { ledger_mobileNav, ledger_subPages_mobileNav, clear_nav} = navSliceMobile.actions

export default navSliceMobile.reducer
